import Link from 'next/link';
import Nav from './Nav';
import styled from 'styled-components';

const Logo = styled.h1`
    background: red;
`;

export default function Header() {
    return (
        <header>
            <div className="bar">
                <Logo>
                    <Link href="/">
                        SickFits
                    </Link>
                </Logo>

            </div>
            <Nav />
            <div className="sub-bar">
                <p>SEARCHY SEARCHY</p>
            </div>
        </header>
    );
}
